import styles from "./Inicio.module.css";
import posts from "assets/json/posts.json"
import PostCard from "Componentes/PostCard";

const Eventos = () => {
    return (
        <ul className={styles.posts}>
            {posts.map(post => (
                <li key={post.id}>
                    <PostCard post={post}/>
                </li>
            ))}
        </ul>
    ) 
}

export default Eventos
